import React, { useState } from "react";

const LoyaltyProgramForm = () => {
  const [formData, setFormData] = useState({
    name: null,
    email: null,
    phone: null,
    password: null,
    confirmPassword: null,
    terms: false,
  });

  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;

    // If it's a checkbox or radio, handle it as a boolean (true/false)
    if (type === "checkbox" || type === "radio") {
      setFormData((prevData) => ({
        ...prevData,
        [name]: checked,
      }));
    } else {
      // If it's a text-based field, update the state
      setFormData((prevData) => ({
        ...prevData,
        [name]: value ? value : null,  // If the value is empty, set it to null
      }));
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission logic here
    console.log(formData);
  };

  return (
    <div className="loyalty-form">
      <style>{`
        .loyalty-form {
          max-width: 28rem;
          margin: 2rem auto;
          padding: 1.5rem;
          background-color: white;
          box-shadow: 0 4px 8px rgba(0, 0, 0, 0.1);
          border-radius: 0.5rem;
        }
        .loyalty-form input, .loyalty-form textarea, .loyalty-form select {
          width: 100%;
          padding: 0.75rem;
          margin: 0.5rem 0;
          border: 1px solid #ccc;
          border-radius: 0.375rem;
        }
        .loyalty-form button {
          width: 100%;
          padding: 0.75rem;
          background-color: #007bff;
          color: white;
          border: none;
          border-radius: 0.375rem;
          font-size: 1rem;
        }
        .loyalty-form button:hover {
          background-color: #0056b3;
        }
        .loyalty-form .form-group {
          margin-bottom: 1rem;
        }
      `}</style>

      <h2 className="text-center font-bold text-2xl">Join Our Loyalty Program</h2>
      <p className="text-center text-gray-600 mb-4">
        Sign up to earn rewards and exclusive offers!
      </p>

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="name" className="block text-sm font-medium text-gray-700">
            Full Name
          </label>
          <input
            id="name"
            type="text"
            name="name"
            placeholder="Enter your full name"
            value={formData.name || ""}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="email" className="block text-sm font-medium text-gray-700">
            Email Address
          </label>
          <input
            id="email"
            type="email"
            name="email"
            placeholder="Enter your email address"
            value={formData.email || ""}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="phone" className="block text-sm font-medium text-gray-700">
            Phone Number
          </label>
          <input
            id="phone"
            type="tel"
            name="phone"
            placeholder="Enter your phone number"
            value={formData.phone || ""}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="password" className="block text-sm font-medium text-gray-700">
            Password
          </label>
          <input
            id="password"
            type="password"
            name="password"
            placeholder="Create a password"
            value={formData.password || ""}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group">
          <label htmlFor="confirm-password" className="block text-sm font-medium text-gray-700">
            Confirm Password
          </label>
          <input
            id="confirm-password"
            type="password"
            name="confirmPassword"
            placeholder="Confirm your password"
            value={formData.confirmPassword || ""}
            onChange={handleInputChange}
          />
        </div>

        <div className="form-group flex items-center mb-4">
          <input
            type="checkbox"
            id="terms"
            name="terms"
            checked={formData.terms}
            onChange={handleInputChange}
            className="h-4 w-4 text-blue-600"
          />
          <label htmlFor="terms" className="ml-2 text-sm font-medium text-gray-700">
            I agree to the{" "}
            <a href="#" className="text-blue-500">
              terms and conditions
            </a>
          </label>
        </div>

        <button type="submit" className="bg-blue-500 text-white rounded-md py-2 hover:bg-blue-600">
          Sign Up
        </button>
      </form>
    </div>
  );
};

export default LoyaltyProgramForm;
